(1, 1, 0, 1, '0000-00-00', 'Discussion', 'Discussion'),
(2, 1, 0, 1, '0000-00-00', 'Building a high-performance call center workplace through a scientifically based selection system', '<p>Workforce improvement has become increasingly important to managers in the recent years of swift technological change and intensified competition. Nowhere is this concern more pressing than in todays rapidly changing call centers. The two principal ways to achieve such improvements are through careful personnel selection and on-the-job employee effectiveness training. Training is often where managers focus most of their efforts. Certainly, new-employee training - dealing primarily with systems and procedures - is essential. Subsequent training interventions concentrating on "soft" performance-enhancement skills, however, have had mixed reviews, and the ability of such costly training programs to yield tangible workforce improvement has not been established. If we shift our focus to personnel selection, though, we will see how the organization that uses systematic pre-employment procedures lays a solid foundation for an ultimately high-performing call center workforce, at a fraction of the cost of later training interventions.<p>\n<p>Pre-Employment Testing In Perspective<p>\n<p>Some call center managers have simply disregarded testing at the personnel selection stage, often as a result of myths which portray testing as inaccurate and somehow dehumanizing. In addition, some managers avoid preemployment testing because of negative experiences with selection instruments that were too brief and ultimately worthless. The marketplace abounds in examples of what we might term the "20-minute wonder" - the quick and inexpensive general-purpose test. Single measures of this length and quality can do more harm than good because the user, oblivious to the fact that such tests lack the job focus, reliability and relevance to provide measurements of real value, may fail to consider other, more valid, information in the hiring context. By using a systems approach, however, the call center manager has access to far better pre-employment assessment tools.<p>\n<p>Over the past four years. we have been conducting research on how to best assess call center applicants and predict success in this line of work. Lets take a look at what has been learned.<p>'),
