INSERT INTO `cool_school_news` (`news_id`, `school_id`, `user_id`, `news_subject`, `news_content`, `news_date`) VALUES
(2, 0, 1, 'Why cool schools?', 'Cool schools is an interactive website, that provides great features for most of parents needs and students, it offers easy access, friendly environment.. we offer a high reliable programs thats suits your need, most of the typical are , enlistment, grades and many more..', '0000-00-00'),
(3, 0, 1, 'test', 'Bringing a new level of cloud-based communications services to its business customers, Canadian carrier TELUS said it is rolling out a next-generation cloud service delivery network that will be based on Ciscoâ€™s Unified Service Delivery infrastructure.\r\n\r\nThe deployment will support TELUS primary goal of expanding its cloud and managed service offerings, the company said in a statement.\r\n\r\nTELUS serves almost 12 million customers in Canada with wireless, landline, and Internet connections. The company plans to use Ciscoâ€™s â€œinfrastructure-as-a-serviceâ€ offering to quickly ramp up cloud-based and managed services for its enterprise customers. Specifically, TELUS will buy more of the Cisco Nexus switching platforms to install in its data centers across Canada. \r\n\r\nThe Unified Service Delivery system uses the Nexus line of switches to bring together dispersed data center and support peering and interconnection between them. Based on Ciscoâ€™s IP Next-Generation Network architecture, the USD systems aims to help operators reduce costs while offering a broad range of cloud communications services.\r\n\r\nThe Cisco platform will â€œenable us to interconnect our diverse data centers, enabling them to act as one, resulting in more efficient and on-demand service delivery to customers," said Tony Krueck, vice president of business products and services at TELUS, in a statement.\r\n\r\nLast week TELUS announced a new suite of IPTV and high speed Internet services under the â€œOptikâ€ brand, for customers in British Columbia and Alberta. Using fiber-to-the-node and last-mile DSL, â€œOptik TVâ€ is based on Microsoftâ€™s Mediaroom software and includes a â€œpersonal video recorderâ€ that networks all TVs in a home. Optik high-speed Internet access offers speeds of up to 25 Mbps, and includes free Wi-Fi connectivity within the home.', '0000-00-00'),
(4, 0, 1, 'AMA Computer University', 'One of the reasons complex analytic dynamics has been such a successful subject\r\nis the deep relation that has surfaced between conformal mapping, dynamics and\r\ncombinatorics. The object of the spider algorithm is to construct polynomials with\r\nassigned combinatorics.\r\nThis shows up when you try to understand the Mandelbrot set. For this discussion\r\nwe will write our quadratic polynomials Qc(z) = z2 +c. Every such polynomial has\r\na filled in Julia set Kc, formed of the points with bounded orbits under iteration of\r\nQc.', '0000-00-00'),
(5, 0, 1, 'angelito', 'haha\r\n\r\nahaha', '0000-00-00'),
(6, 0, 1, 'The Spider Algorithm', 'Mandelbrot set M is shown to be connected. Now call\r\nRM(Î¸) = Î¦âˆ’1\r\nM\r\n\r\n{re2Ï€iÎ¸ | r > 1}\r\n\r\nthe external ray of M at angle Î¸. When the limit\r\nlim\r\nr1\r\nÎ¦âˆ’1\r\nM (re2Ï€iÎ¸)\r\nexists, we say that the ray at angle Î¸ lands at the limit point.\r\nSomething which sounds like magic occurs: If Î¸ is rational, then the ray at angle\r\nÎ¸ does land at some point cÎ¸, and the dynamics of QcÎ¸ reflects the digits of Î¸ written\r\nin base 2. This is proved in [DH1] a simpler proof can be found in [S]. A couple of\r\nexamples should bring out what this means.\r\nExample 1. Consider the polynomial z2 + i, which is at the end of the ray at\r\nangle 16 turn. The number 16 is written in base 2\r\n16 = .0 01 01 01 01 . . .\r\nand under iteration of z â†’ z2 + i, the orbit of 0 is\r\ni âˆ’ 1 + i âˆ’ i âˆ’ 1 + i âˆ’ i âˆ’ 1 + i âˆ’ i . . .\r\nBoth after one term repeat with period 2.\r\nExample 2. The external rays of M at angles 13 and 23 land at âˆ’0.75, the\r\nroot of the component of\r\nâ—¦\r\nM in which all polynomials have an attractive cycle of\r\nperiod 2\r\n13 = .01 and 23 = .10\r\nare the numbers which in base 2 have digits which repeat with period 2.\r\nSimilarly, the rays at angle 37 and 47 land at âˆ’74, which is the root of a\r\ncomponent of\r\nâ—¦\r\nM in which the polynomials have an attractive cycle of period 3.\r\nNote that\r\n37 = .011 and 47 = .100 \r\nboth have digits which repeat with period 3. This pattern extends to all hyperbolic\r\ncomponents of the interior of M (presumably, all components are hyperbolic).\r\nThese examples illustrate the sort of combinatorics polynomials may have under\r\niteration. We will restrict our attention to polynomials for which the critical point\r\nhas a finite orbit under iteration, which means it becomes eventually periodic. We\r\nwill be interested in the lengths of periodic cycles, and also in the order in which\r\npoints of a cycle appear. This has an obvious meaning when the polynomials and\r\nJ.H. Hubbard and D. Schleicher 3\r\ncycles are real (see Section 1) and the appropriate generalization to the complex\r\ncase can be found in Section 2.\r\nThe spider algorithm is an answer both to the question of which combinatorial\r\npatterns are realized by polynomials and how to find them. The finiteness of the\r\ncritical orbit gives an algebraic equation, but this equation does not distinguish\r\nthe combinatorics of its many solutions. For instance, if you look for quadratic\r\npolynomials Pc(z) = z2+c for which the critical point is periodic of period p, where\r\np is prime, you land on an equation of degree 2pâˆ’1 âˆ’ 1 after removing the trivial\r\nfactor, but the algebra does not distinguish between the solutions.\r\nThe underlying techniques of the spider algorithm are due to Bill Thurston and\r\nhave been elaborated on by many others: Ben Bielefeld, Adrien Douady, Yuval\r\nFisher, Lisa Goldberg, Janet Head, Silvio Levi, Jiaqi Luo, Jack Milnor, Curt Mc-\r\nMullen, Alfredo Poirier, Mary Rees, Mitsuhiro Shishikura, Dennis Sullivan, Tan\r\nLei, Ben Wittner, and no doubt others to whom we owe apologies. Yuval Fisher\r\nand Ben Bielefeld have written programs implementing the spider algorithm.\r\nThurstonâ€™s theorem reduces the problem of finding a rational function with assigned\r\ncombinatorics to finding a fixed point for a mapping in an appropriate Teichm\r\nÂ¨uller space. He shows that either such a fixed point exists and is unique, or there\r\nis a Thurston Obstruction, which consists of a set of simple closed curves having\r\nspecial properties. The proof, written in [DH2], is deep and difficult.\r\nIn Section 7 we will give a proof of a special case in which there is no obstruction.\r\nThis proof is much easier and can serve as an introduction to the general case. We\r\nalso show with an example how an obstruction can prevent such a fixed point from\r\nexisting.\r\nLet the reader be reassured: this paper does not require any knowledge of Teichm\r\nÂ¨uller theory, or quasiconformal mappings, etc. The TeichmÂ¨uller space is replaced\r\nby the (more intuitive) space of spiders, and the Thurston mapping by the spider\r\nmap.', '0000-00-00'),
